create table samqa.online_form_5500_plan_staging (
    enrollment_detail_id           number(10, 0),
    enrollment_id                  number(10, 0),
    entrp_id                       number(10, 0),
    batch_number                   number(10, 0),
    plan_name                      varchar2(150 byte),
    plan_number                    varchar2(30 byte),
    effective_plan_date            varchar2(50 byte),
    plan_start_date                varchar2(50 byte),
    plan_end_date                  varchar2(50 byte),
    plan_type                      varchar2(50 byte),
    active_participants            number(10, 0),
    recv_benefits                  number(10, 0),
    future_benefits                number(10, 0),
    total_no_ee                    number(10, 0),
    is_coll_plan                   varchar2(1 byte),
    no_of_schedule_a_doc           number(10, 0),
    sponsor_name                   varchar2(100 byte),
    sponsor_contact_name           varchar2(100 byte),
    sponsor_email                  varchar2(100 byte),
    sponsor_tel_num                varchar2(100 byte),
    sponsor_business_code          varchar2(50 byte),
    sponsor_ein                    varchar2(50 byte),
    admin_name_sameas_sponsor_flag varchar2(1 byte),
    admin_name                     varchar2(100 byte),
    admin_contact_name             varchar2(100 byte),
    admin_email                    varchar2(100 byte),
    admin_tel_num                  varchar2(100 byte),
    admin_business_code            varchar2(50 byte),
    admin_ein_sameas_sponsor_flag  varchar2(1 byte),
    admin_ein                      varchar2(20 byte),
    admin_addr                     varchar2(100 byte),
    admin_city                     varchar2(50 byte),
    admin_zip                      varchar2(10 byte),
    admin_state                    varchar2(2 byte),
    pre_sponsor_name_ein_flag      varchar2(1 byte),
    previous_sponsor_name          varchar2(100 byte),
    previous_sponsor_ein           varchar2(50 byte),
    erisa_wrap_flag                varchar2(1 byte),
    collective_plan_flag           varchar2(1 byte),
    plan_fund_code                 varchar2(100 byte),
    plan_benefit_code              varchar2(100 byte),
    tot_price                      varchar2(50 byte),
    page_validity                  varchar2(20 byte),
    creation_date                  date,
    created_by                     number(10, 0),
    modified_date                  date,
    modified_by                    number(10, 0),
    ben_plan_id                    number,
    short_plan_year_flag           varchar2(1 byte),
    extention_flag                 varchar2(1 byte),
    dfvc_program_flag              varchar2(1 byte),
    other_feature_code             varchar2(200 byte),
    last_employer_name             varchar2(100 byte),
    last_plan_name                 varchar2(100 byte),
    last_ein                       varchar2(20 byte),
    last_plan_number               varchar2(30 byte),
    erisa_wrap_plan_flag           varchar2(1 byte),
    l_day_active_participants      number(10, 0),
    enrolled_empl_1st_day_pln_yr   number(10, 0),
    next_yr_short_plan_year_flag   varchar2(1 byte),
    next_yr_plan_start_date        varchar2(50 byte),
    next_yr_plan_end_date          varchar2(50 byte),
    send_doc_later_flag            varchar2(1 byte),
    ben_plan_id_next               number,
    ben_plan_id_main               number,
    ben_plan_flag                  varchar2(1 byte) default 'N',
    acc_num                        varchar2(50 byte)
);

alter table samqa.online_form_5500_plan_staging add primary key ( enrollment_detail_id )
    using index enable;


